import "./App.css";
import Routes from "./pages/routes";
import { ProductProvider } from "./provider/products";

function App() {
  return (
    <ProductProvider>
      <div className="App">
        <Routes></Routes>
      </div>
    </ProductProvider>
  );
}

export default App;
